import React from 'react'
import Dashboard from '../Dashboard'

export default function Movies() {
    return (
        <div>
            <Dashboard/>
            <h1 style={{display:'flex', justifyContent: 'center', 
            alignItems:'center', height: '90vh'}}>TV Shows Page</h1>
            </div>
    )
}
